import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles({
  root: {
    maxWidth: 345,
  },
  media: {
    height: 140,
  },
});

export default function MediaCard() {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="https://images.search.yahoo.com/yhs/search;_ylt=AwrEePRu0qpfviAALQQPxQt.;_ylu=Y29sbwNiZjEEcG9zAzEEdnRpZAMEc2VjA3BpdnM-?p=inventario+logo+png&type=__alt__ddc_linuxmint_com&hsimp=yhs-linuxmint&hspart=ddc&ei=UTF-8&fr=yhs-ddc-linuxmint&guccounter=1&guce_referrer=aHR0cHM6Ly9zZWFyY2gueWFob28uY29tL3locy9zZWFyY2g_aHNwYXJ0PWRkYyZoc2ltcD15aHMtbGludXhtaW50JnR5cGU9X19hbHRfX2RkY19saW51eG1pbnRfY29tJnA9aW52ZW50YXJpbytsb2dvK3BuZw&guce_referrer_sig=AQAAAIBNQljsTZ_f6xdIJSlAluTqvAMRGJoiLRw6anwGQpIy6MxGoZhN4Odv5H_gSnr0W1Bt7xSbuXzoI1DOFJw6ppN6Bp6_u2mYxqEwISMbttq_tGAqo98u1C_I8yT4sVh-7kfah2j7jN1m6qQ6-faXfYWX6hXplmWBMjKtHwHAzWom#id=4&iurl=http%3A%2F%2Fwww.nusystem.cl%2Fwp-content%2Fuploads%2F2014%2F06%2Fport_inventario_ico_300x300.png&action=click"
          title="Inventario"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Inventario
          </Typography>

        </CardContent>
      </CardActionArea>
    </Card>
  );
}
